import React from 'react';

const Logout = ({ setIsLoggedIn }) => {
  const handleLogout = () => {
    // ログアウト状態に更新する関数を呼び出す
    setIsLoggedIn(false);
  };

  return (
    <div>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
};

export default Logout;
